import React from 'react';
import { BrowserRouter,Route,Routes } from 'react-router-dom';
import Home from './Home';

function App() {
  return (
    <div>
      <BrowserRouter>
         <Routes>
         <Route path="/" element={<Home/>} exact/>
         </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
